import React from "react";
import { Carousel } from "react-bootstrap";
import autosalon from "./autosalon.jpg";

const Contacts = () => {
  return (
    <Carousel>
      <Carousel.Item>
        <img className="d-block w-50" src={autosalon} alt="First slide" />
        <Carousel.Caption>
          <h3>Контакты и адреса</h3>
          <p>Саратов</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
};

export default Contacts;
